Patch Set 27:

The problem seems to be with this test: tests/failure/test_failpoints.py::TestFailpoints::test_failpoints, and this query in particular:

SET mt_dop=4;
SET batch_size=0;
SET num_nodes=0;
SET disable_codegen_rows_threshold=0;
SET disable_codegen=False;
SET abort_on_error=1;
SET exec_single_node_rows_threshold=0;
SET debug_action=0:PREPARE_SCANNER:MEM_LIMIT_EXCEEDED|COORD_BEFORE_EXEC_RPC:JITTER@100@0.3;
SELECT STRAIGHT_JOIN *
FROM functional_kudu.alltypes t1
JOIN /*+broadcast*/ functional_kudu.alltypesagg t2 ON t1.id = t2.id
WHERE t2.int_col < 1000;

It seems that when reading a Kudu table, the code for kudu::BlockBloomFilter may come from different places
- from the Kudu (binary?) dependency and
- be/src/kudu/util/block_bloom_filter.h

The crash happens because an assert in Kudu as kudu::BlockBloomFilter::hash_algorithm_ has an invalid value.

I think it is caused by binary incompatibility between our modified kudu::BlockBloomFilter and the original one, used in Kudu. I have added two fields just before kudu::BlockBloomFilter::hash_algorithm_ and probably that data is treated as if it were the hash_algorithm_ field by the original Kudu code. When I put the new fields to the end of the class, the crash doesn't happen.
